const NavBarButton = () =>{
    return(
        <>
        <button type="button" className="button-icon"><span className="icon icon-user"/></button>
        <button type="button" className="button-icon"><span className="icon icon-card"/></button>
        <button type="button" className="button-icon"><span className="icon icon-heart"/></button>
        </>
    )
};
export default NavBarButton;
